/**
// Description:
 *
 * M&M sorting machine on the Nexys4 DDR FPGA.
 * Integrate the Raspberry Pi with Nexys4 DDR FPGA
 * Raspberry Pi and camera system.
 * Raspberry Pi - Do the image processing part and send a cropped image file to FPGA for color detection.
 * Image classification and detection of color on Nexys4 FPGA.(Machine learning)
 * Nexys4 sends the PWM signals to the servos for separation of M&M according to the color detected.
 * PmodOLEDrgb displays the color of detected M&M.

******************************************************************************/

