/************************** MAIN PROGRAM ************************************/
int main(void)
{
	//Local variable
    int ReceivedCount=0;
    float X[TEST_BUFFER_SIZE];
	uint32_t sts;
	float X1[TEST_BUFFER_SIZE];
	int i,j;

	//Initialization
	sts = do_init();
	if (XST_SUCCESS != sts)
	{
		exit(1);
	}

	//Set servos to initial positions
	servo1_PWM(5);
	servo2_PWM(5);

	//Set OLEDrgb display to display the detected color
	OLEDrgb_Clear(&pmodOLEDrgb_inst);
	OLEDrgb_SetFontColor(&pmodOLEDrgb_inst,OLEDrgb_BuildRGB(200, 12, 44));

	OLEDrgb_SetCursor(&pmodOLEDrgb_inst, 0, 1);
	OLEDrgb_PutString(&pmodOLEDrgb_inst,"Detected");
	OLEDrgb_SetCursor(&pmodOLEDrgb_inst, 4, 2);
	OLEDrgb_PutString(&pmodOLEDrgb_inst,"Color");

	while(1)
	{
		while(1)
			{	//BTNC for starting the sorting process of M&M
				if (NX4IO_isPressed(BTNC))
				{
					//Send signal to raspberry pi to start the process
					SendBuffer[0]=1;
					int SentCount = XUartLite_Send(&UartLite, SendBuffer, TEST_BUFFER_SIZE_2);

					break;
				}
			}



		while (1)
		{
			//Receive the image from raspberry pi through UART
			ReceivedCount += XUartLite_Recv(&UartLite,
						   RecvBuffer + ReceivedCount,
						   TEST_BUFFER_SIZE - ReceivedCount);
			if (ReceivedCount == TEST_BUFFER_SIZE) {
				break;
		}
		}

		//copy pixel values from receive buffer to local variable
		for (int Index = 0; Index < TEST_BUFFER_SIZE; Index++)
		{
			X[Index]= RecvBuffer[Index];
		}

		//Reset the receive buffer and receive counts
		for (int Index = 0; Index < TEST_BUFFER_SIZE; Index++)
		{
			RecvBuffer[Index] = 0;
		}
		ReceivedCount = 0;
		xil_printf(" 784 values \n");

		//Normalize the pixel values for calculation
		for(int i=0;i<TEST_BUFFER_SIZE;i++)
		{
			X1[i] = X[i]/255;
		}

		//calculation for 100 nodes of hidden layer
		float y[100]={0};
		for(i=0;i<100;i++)
		{
			for(j=0;j<784;j++)
			{
				y[i] +=(X1[j]*w1[i][j]) ;
			}

			y[i] = (0<y[i]) ? y[i]:0;
		}
		//calculation for 3 nodes of output layer
		float z[3]={0};
		for(i=0;i<3;i++)
		{
			for(j=0;j<100;j++)
			{
				z[i] +=y[j]*w2[i][j] ;
			}
			z[i] = (0<z[i]) ? z[i]:0;
		}

		//Comparison between output nodes to classify the color
		//predicted color(node) has higher value
		//if 1st node has higher value-->Blue color
		//if 2nd node has higher value-->Green color
		//if 3rd node has higher value-->Red color
		if (z[0] > z[1] && z[0] > z[2])
		{
			xil_printf("Blue\n");

			//set OLEDRGB display to display blue color
			OLEDrgb_DrawRectangle(&pmodOLEDrgb_inst, 40,30 ,90 ,60,OLEDrgb_BuildRGB(0,0, 255), TRUE,OLEDrgb_BuildRGB(0, 0, 255));

			//Set servos according to blue color (Left)
			servo1_PWM(2);
			sleep(1);
			servo2_PWM(10);
			sleep(1);

		}
		else if (z[1] > z[0] && z[1] > z[2])
		{
			xil_printf("Green\n");
			//set OLEDRGB display to display green color

			OLEDrgb_DrawRectangle(&pmodOLEDrgb_inst, 40,30 ,90 ,60,OLEDrgb_BuildRGB(0,255,0), TRUE,OLEDrgb_BuildRGB(0,255,0));

			//Set servos according to Green color (Center)
			servo1_PWM(5.5);
			sleep(1);
			servo2_PWM(10);
			sleep(1);
		}
		else if (z[2] > z[0] && z[2] > z[1])
		{
			xil_printf("Red\n");

			//set OLEDRGB display to display green color
			OLEDrgb_DrawRectangle(&pmodOLEDrgb_inst, 40,30 ,90 ,60,OLEDrgb_BuildRGB(255,0, 0), TRUE,OLEDrgb_BuildRGB(255,0,0));

			//Set servos according to Green color (Right)
			servo1_PWM(9);
			sleep(1);
			servo2_PWM(10);
			sleep(1);
		}


		//Set servos to the initial position
		servo1_PWM(5.5);
		sleep(2);
		servo2_PWM(5.5);
		sleep(1);
	}

	OLEDrgb_SetCursor(&pmodOLEDrgb_inst, 4, 2);
	OLEDrgb_SetFontColor(&pmodOLEDrgb_inst ,OLEDrgb_BuildRGB(0, 0, 255));  // blue font
	OLEDrgb_PutString(&pmodOLEDrgb_inst,"BYE BYE");

	usleep(5000 * 1000);

	// clear the displays and power down the pmodOLEDrbg
	NX410_SSEG_setAllDigits(SSEGHI, CC_BLANK, CC_B, CC_LCY, CC_E, DP_NONE);
	NX410_SSEG_setAllDigits(SSEGLO, CC_B, CC_LCY, CC_E, CC_BLANK, DP_NONE);
	OLEDrgb_Clear(&pmodOLEDrgb_inst);
	OLEDrgb_end(&pmodOLEDrgb_inst);

	// cleanup and exit
    cleanup_platform();
    exit(0);
}

